import { useParams } from "react-router-dom"

export default function Category() {
  let { id } = useParams()
  return (
    <section class="container-md">
      <div class="row">
        <div class="col-12">
          <div class="row" id="songs"></div>
        </div>
      </div>
    </section>
  )
}
